        <card>
            <div slot="title">标题</div>
            <div slot="content">
                <div class="MyContent"><p>今天发现了一个问题,就是通过代码来为Material设置法线贴图,但是设置后没有效果,需要在场景中来回切换一下才可以.如图所示:</p><p><img src="data:image/gif;base64," style="max-width:100%;"><br></p><p><br></p><p>这是我Test里面的代码:</p><pre><code>    [MenuItem("Test/Test")]<br>    public static void Test()<br>    {<br>        Texture texture = Resources.Load&lt;Texture&gt;("BMW.fbm/luntai_Low_Luntai_Normal");<br>        Material material = Resources.Load&lt;Material&gt;("Materials/luntai_Low_Luntai_AlbedoTransparency");<br>        material.SetTexture("_BumpMap", texture);<br>    }</code></pre><p>没什么特别的,就是将Texture和Material加载出来并且将Texture设置为Material的法线贴图!不管怎么刷新<span style="background-color: rgb(249, 150, 59);">AssetDatabase.Refresh</span>或者导入<span style="background-color: rgb(249, 150, 59);">AssetsSetting.ImportAsset</span>都没用,最后在官网找到解决方案!</p><p>需要使用EnableKeyword方法来为<strong></strong>Standard Shader启用正确的关键字!例如对于设置法线贴图而言只需要添加一行代码即可:</p><pre><code>    [MenuItem("Test/Test")]<br>    public static void Test()<br>    {<br>        Texture texture = Resources.Load&lt;Texture&gt;("BMW.fbm/luntai_Low_Luntai_Normal");<br>        Material material = Resources.Load&lt;Material&gt;("Materials/luntai_Low_Luntai_AlbedoTransparency");<br>        material.SetTexture("_BumpMap", texture);<br>        <span style="background-color: rgb(249, 150, 59);">material.EnableKeyword("_NORMALMAP");</span><br>    }</code></pre><p>关于该问题的更多详细信息,请查看官网文档:<a href="https://docs.unity3d.com/Manual/MaterialsAccessingViaScript.html" target="_blank" style="background-color: rgb(255, 255, 255);">https://docs.unity3d.com/Manual/MaterialsAccessingViaScript.html</a></p><p><br></p><p><br></p><p><br></p></div>
